import { useState } from "react";
import "./App.css";

function Modal({ open }) {
  console.log(open);
  return <div className="home__modal"></div>;
}

function App() {
  const [open, setOpen] = useState(false);
  return (
    <div className="home">
      <h1>Coucou ZoK !</h1>
      <button onClick={() => setOpen(true)} className="home__button">
        click me !
      </button>
      <Modal open={open} />
    </div>
  );
}

export default App;
